import React, { Component } from 'react';
import { useParams } from 'react-router';
import Navbar from '../Navbar/Navbar';
import "bootstrap/dist/css/bootstrap.min.css";
import "./Mealplan.css"

class MealPlan extends Component {
    constructor(props){
        super(props)
        this.state = {
            sunday: [null, null, null],
            monday: [null, null, null],
            tuesday: [null, null, null],
            wednesday: [null, null, null],
            thursday: [null, null, null],
            friday: [null, null, null],
            saturday: [null, null, null]
        }
    }

    // componentDidMount(){
    //     const config = {
    //         headers: {
    //             "x-access-token": localStorage.getItem("token")
    //         }
    //     }
    //     axios.get('http://localhost:5000/mealplan/' + this.props.match.params.id, config)
    // }
    
    render() {
        return (
            <>
            <Navbar></Navbar>
            <div>
                <h1>{this.props.match.params.id}</h1>
            </div>
            <div class="container-fluid" id="MealplanContainer">
                <div class="row">
                    <div class="col-1">
                        Sunday
                    </div>
                    <div class="col-1">
                        Monday
                    </div>
                    <div class="col-1">
                        Tuesday
                    </div>
                    <div class="col-1">
                        Wednesday
                    </div>
                    <div class="col-1">
                        Thursday
                    </div>
                    <div class="col-1">
                        Friday
                    </div>
                    <div class="col-1">
                        Saturday
                    </div>
                </div>
                <div class="row">
                    <div class="col">
                        <div class="card" style={{width: "200px"}}>
                            <img src="https://spoonacular.com/recipeImages/579247-240x150.jpg" class="card-img-top" alt="..." />
                            <div class="card-body">
                                <h5 class="card-title">Card title</h5>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            </>
            
        )
    }
}

export default MealPlan
